-- ----------------------------
-- Table structure for pms_project
-- ----------------------------
DROP TABLE IF EXISTS `pms_project`;
CREATE TABLE `pms_project` (
  `project_id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `project_sn` varchar(300) NOT NULL DEFAULT '' COMMENT '项目编号',
  `project_title` varchar(300) NOT NULL DEFAULT '' COMMENT '项目名称',
  `project_parent_id` int(11) DEFAULT '0' COMMENT '上级项目ID',
  `user_id` int(10) DEFAULT NULL COMMENT '项目负责人ID',
  `dept_id` int(10) DEFAULT NULL COMMENT '部门ID',
  `project_desc` text COMMENT '项目概述',
  `project_saler` int(11) DEFAULT NULL COMMENT '销售人员',
  `project_saler2` int(11) DEFAULT NULL COMMENT '销售人员2',
  `project_assistant` int(11) DEFAULT NULL COMMENT '项目助理',
  `project_amount` decimal(10,2) DEFAULT '0.00' COMMENT '项目合同金额',
  `project_received_payment` decimal(10,2) DEFAULT '0.00' COMMENT '当前已收款',
  `project_estimate_cost` decimal(10,2) DEFAULT '0.00' COMMENT '预估成本',
  `project_estimate_cost_de` decimal(10,2) DEFAULT '0.00' COMMENT '预估设计成本',
  `project_estimate_cost_fe` decimal(10,2) DEFAULT '0.00' COMMENT '预估前端成本',
  `project_estimate_cost_be` decimal(10,2) DEFAULT '0.00' COMMENT '预估后端成本',
  `project_market_price` decimal(10,2) DEFAULT '0.00' COMMENT '市场价格',
  `project_curr_cost` decimal(10,2) DEFAULT '0.00' COMMENT '当前成本',
  `project_material_cost` decimal(10,2) DEFAULT '0.00' COMMENT '材料费用',
  `project_outsource_cost` decimal(10,2) DEFAULT '0.00' COMMENT '外包总成本',
  `project_return_cost` decimal(10,2) DEFAULT '0.00' COMMENT '渠道返点',
  `project_type` int(10) DEFAULT NULL COMMENT '项目类型',
  `project_level` int(10) DEFAULT '0' COMMENT '项目等级（1级别A 2级别B 3级别C 4级别D 5级别E）',
  `project_requirements` longtext COMMENT '项目需求',
  `project_attribute` varchar(10) DEFAULT NULL COMMENT '项目属性',
  `project_plan` int(10) DEFAULT '0' COMMENT '项目方案',
  `project_sense` varchar(200) DEFAULT '' COMMENT '应用场景',
  `project_industry` varchar(50) DEFAULT '' COMMENT '所属行业',
  `project_negotiator` varchar(50) DEFAULT '' COMMENT '洽谈人员',
  `project_negotiation_status` tinyint(1) DEFAULT '0' COMMENT '洽谈状态（0 未洽谈 1 已洽谈）',
  `project_negotiation_time` datetime DEFAULT NULL COMMENT '洽谈时间',
  `project_negotiation_way` tinyint(1) DEFAULT '0' COMMENT '洽谈方式（1仅报价 2 微信/电话 3 面谈）',
  `project_negotiation_num` int(10) DEFAULT '0' COMMENT '洽谈次数',
  `project_negotiation_hours` int(10) DEFAULT '0' COMMENT '洽谈时长',
  `project_is_design_scheduled` int(10) DEFAULT '0' COMMENT '设计已排期（0否 1是）',
  `project_edition` varchar(50) DEFAULT '' COMMENT '项目版本',
  `project_case` varchar(200) DEFAULT '' COMMENT '参考案例',
  `project_contract_duration` varchar(200) DEFAULT '' COMMENT '合同工期',
  `project_start_date` datetime DEFAULT NULL COMMENT '开工日期',
  `project_test_days` int(10) DEFAULT NULL COMMENT '测试时间',
  `project_is_special` varchar(10) DEFAULT '0' COMMENT '特价项目（0否 1是）',
  `project_special_price` decimal(10,2) DEFAULT '0.00' COMMENT '特价金额',
  `project_status` int(10) DEFAULT '0' COMMENT '项目状态（0初始状态 1意向询价 2洽谈阶段 3签订合同 4确认需求 5UI设计 6前端开发 7后端开发 8内测阶段 9交付测试 10已结项 11已暂停 12 协商退款 13已退款）',
  `project_resale_status` varchar(10) DEFAULT '0' COMMENT '复卖性（0无 1强 2弱）',
  `project_resale_reason` text COMMENT '复卖原因说明',
  `project_template_state` tinyint(4) DEFAULT '0' COMMENT '模板状态（0无搭建计划 1已搭建 2未搭建）',
  `project_template_reason` text COMMENT '模板说明',
  `project_contract_url` varchar(300) DEFAULT '' COMMENT '合同保存地址',
  `project_document_url` varchar(300) DEFAULT '' COMMENT '需求文档保存地址',
  `project_order_status` varchar(10) DEFAULT '0' COMMENT '签约状态（0未签约 1已签约）',
  `project_order_time` datetime DEFAULT NULL COMMENT '签单时间',
  `project_is_hidden` int(10) DEFAULT '0' COMMENT '是否隐藏（0否 1是）',
  `project_git_repo` varchar(1000) DEFAULT NULL COMMENT 'Git仓库名',
  `deliverables_ids` text COMMENT '成果物ID集合',
  `del_flag` char(1) CHARACTER SET utf8mb4 DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
  `create_by` varchar(64) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`project_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=93 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='项目表';

-- ----------------------------
-- Records of pms_project
-- ----------------------------
